Movie Info: Yaariyan is a 2014 Bollywood college-based romance adventure film directed by Divya Khosla Kumar, starring Himansh Kohli, Serah Singh and Rakul Preet Singh in the lead roles. It marks the debut of the director as well as the lead star cast. The film was produced by Bhushan Kumar and Krishan Kumar under the banner of T-Series Super Cassettes Industries.

Shot in St. Bede's College, Shimla, Yaariyan tells the story of close knit 5 friends who are exploring the best moments of their lives in college, experiencing different relationships and learning new values every day. The theatrical trailer of the film released around 30 October 2013. It has crossed over 1 million views in just a few weeks. The film released on 10 January 2014.


